INSERT INTO `CustomNavbars` VALUES (1,'Filming During Covid',NULL,'2021-09-01 23:03:46','2021-09-01 23:04:11',0,'<p>It is currently possible to do productions in Indonesia.</p><p>Needless to say, we take all needed precautions and rely on government guidelines along with our own strong sense of ethics and morals in our work. And we constantly make sure to update our operational behavior and workflows accordingly.</p><p>Working during a crisis is not easy, but luckily part of our job has always been to adapt to unforeseen circumstances.</p><p>The status of the pandemic and health regulations changes from day to day in each country, and that is why we believe the best way to go about film production is to assess everything from project to project.</p><p>Feel free to contact us with any questions or requests and we will tailor a solution for you.</p>');
