INSERT INTO `Services` VALUES (1,'<p>Flex Films is a Indonesia based Production Company providing a full range of line production services to overseas clients.</p><p>Indonesia is unique amongst its rivals, its an archipelago comprising approximately 17,508 islands, has one of longest coastlines in the world, measuring 54,716 kilometers has much natural beauty to over. Indonesia is blessed with the most diverse landscape, from fertile Riceland, sand dunes, volcanoes, luxuriant rain-forests, savannah grasslands, white sandy beaches, green river valleys, snow-capped peaks to the heart of busy capital Jakarta.</p><p>The Indonesian archipelago harbour many ancient cultures that are rooted here, while throughout its history through centuries until today the islands have been influenced by Indian, Chinese, Arabic and European cultures. Culturally, Indonesia fascinates with her rich diversity of ancient temples, Animistic heritage, historical Mosques, Church, Temples, Colonial architecture, music, dance, rituals and ways of life, ranging from the traditional to modern pop, changing from island to island, from region to region. Producing unique “Indonesian” that can\'t found anywhere else in the world.</p><p>With our experienced location managers and local partners, we will help you find exactly what your production requires. We offer a complete service package: organising permits, managing transportation and accommodations, and meeting your every need.</p><p>We assist in all areas of media production from still photography and fashion shoots to commercials, feature films and TV-Series, as well as corporate films.</p>','2021-09-01 23:01:47','2021-09-01 23:01:47');
/*!40000 ALTER TABLE `Services` ENABLE KEYS */;
